window.bookSummaryJSON = "The debut of one of literature's favorite sleuths! Maisie Dobbs isn't just any young housemaid. Through her own natural intelligence - and the patronage of her benevolent employers - she works her way into college at Cambridge. After the War I and her service as a nurse, Maisie hangs out her shingle back at home: M. DOBBS, TRADE AND PERSONAL INVESTIGATIONS. <p>But her very first assignment, seemingly an ordinary infidelity case, soon reveals a much deeper, darker web of secrets, which will force Maisie to revisit the horrors of the Great War and the love she left behind.</p>"; 
